import React , {Component} from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

class Provincia extends Component {
  state ={ provincias:[]}
componentDidMount(){
  axios
  .get("http://127.0.0.1:8000/api/welcome")
  .then((response) =>{
    console.log(response);
    this.setState({provincias: response.data})
})
.catch((error) =>{
  console.log(error);
});
}
  render(){  
  return (
   <div className="container col-lg-12">
      
     <div className="form-group">
<select name="provincias" className="form-control">
  {this.state.provincias.map(elemento=>(

    <option key={elemento.region_id} value={elemento.id}>{elemento.nombreprovi}</option>
  ))}
</select>

     </div>
    
   </div>
  );
}
}


export default Provincia;
